ClearCollect(
    I4_0_DPMS_CSL_XXX_CIS,
    {
        FACode: "FA",
        FLCode: "FL",
        FA: "Reliability",
        FL: "R1",
        ObjCreateDate: "10/19/2022",
        ObjId: "ORG1BU1FA1FL1OB1",
        IssueStatus: "No Started",
        IssueProgress: "0%",
        ObjOwner: "Jameer Kutubuddin Sabkhan"
    }
);
//Set the ObjId 
Set(
    I4_0_DPMS_CSL_GnO_CI_LVOBJID,
    First(I4_0_DPMS_CSL_XXX_CIS).ObjId
);
//local variables for IssueId & No
Set(
    I4_0_DPMS_CSL_GnO_CI_LVISPN,
    Last(
        Filter(
            'I4_0_DPMS_CSL_GnO-IS',
